import React from 'react';
import Produit from './Produit';
import Menu from './Menu';

const Body = () => {
    const style = {
        backgroundColor: "#f8f9fa",
    };
    return (
        <>
            <div className="row">
                <div className="col-md-1"></div>
                <div className="col-md-7" style={style}>
                    <div className="row">
                        <Produit />
                        <Produit />
                        <Produit />
                        <Produit />
                        <Produit /> <Produit />
                    </div>
                </div>
                <div className="col-md-1"></div>
                <div className="col-md-2" style={style}>
                    <div className="row">
                        <Menu title={'Filter'} />
                    </div>
                </div>
                <div className="col-md-1"></div>
            </div>

        </>
    );
};

export default Body;
